contracts/User.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "constants/Errors.const.sol";
import "contracts/RoleManager.sol";

contract UserManagerContract {
    RoleManagerContract roleManager;
    enum Gender { Male, Female, Other }

    struct User {
        string fullName;
        uint256 dateOfBirth;
        Gender gender;
    }

    mapping(address => User) private users;

    constructor(address _roleManagerAddress) {
        roleManager = RoleManagerContract(_roleManagerAddress);
        
        users[msg.sender] = User("Admin", 10000000, Gender.Other);
    }

    modifier userIsNotCreated(address userAddr) {
        require(users[userAddr].dateOfBirth == 0, ErrorCodes.ERROR_USER_IS_CREATED);
        _;
    }

    modifier userIsFound(address userAddr) {
        require(users[userAddr].dateOfBirth > 0, ErrorCodes.ERROR_USER_IS_NOT_FOUND);
        _;
    }

    modifier onlyRole(RoleManagerContract.RoleType role) {
        require(roleManager.getRole() == role, ErrorCodes.ERROR_UNAUTHORIZED);
        _;
    }

    function createUser(string memory _fullName, uint256 _dateOfBirth, Gender _gender) 
    public userIsNotCreated(msg.sender) {
        users[msg.sender] = User(_fullName, _dateOfBirth, _gender);
        roleManager.setStudentRole(msg.sender);
    }                                                                                                                                                                                                                                                                           

    function getCurrentUserData() 
    public view userIsFound(msg.sender) 
    returns (User memory)  {
        User memory user = users[msg.sender];
        return user;
    }

    function getOtherUserData(address userAddr) 
    public view userIsFound(userAddr) 
    returns (User memory) {
        User memory user = users[userAddr];
        return user;
    }
}

contracts/RoleManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "constants/Errors.const.sol";

contract RoleManagerContract {
    enum RoleType {ADMIN, ORGANIZATION, STUDENT}

    mapping(address => RoleType) private userRoles;

    constructor() {
        userRoles[msg.sender] = RoleType.ADMIN;
    }

    modifier onlyRole(RoleType role) {
        require(getRole() == role, ErrorCodes.ERROR_UNAUTHORIZED);
        _;
    }

    function setAdminRole(address userAddr) public onlyRole(RoleType.ADMIN) {
        userRoles[userAddr] = RoleType.ADMIN;
    }

    function setOrganizationRole(address userAddr) public onlyRole(RoleType.ADMIN) {
        userRoles[userAddr] = RoleType.ORGANIZATION;
    }

    function setStudentRole(address userAddr) public onlyRole(RoleType.ADMIN) {
        userRoles[userAddr] = RoleType.STUDENT;
    }

    function getRole() public view returns(RoleType) {
        return userRoles[msg.sender];
    }
}

constants/Errors.const.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

library ErrorCodes {
    // User errors
    string public constant ERROR_USER_IS_NOT_FOUND = "USER_IS_NOT_FOUND";
    string public constant ERROR_USER_IS_CREATED = "USER_IS_CREATED";

    // Authorized errors
    string public constant ERROR_UNAUTHORIZED = "UNAUTHORIZED";
}

